import React from "react";
import Container from "react-bootstrap/Container";
import { Button, Form, Row, Col } from "react-bootstrap";
import TypeBar from "../components/TypeBar";

const Shop = () => {
  return (
    <Container>
      <Row className="mt-2">
        <Col md={3}>
          <TypeBar />
        </Col>

        <Col md={9}></Col>
      </Row>
    </Container>
  );
};

export default Shop;
